module.exports = {
  api: {
    base_url: "http://localhost:9000",
  },
  clients: {
    jpm: {
      name: "JPM",
      envs: {
        jpm_prod_b: "JPM PROD B",
        stage: "STAGE",
        dev: "DEV",
        jpm_prod_c: "JPM PROD C",
      },
    },
    citi: {
      name: "CITI",
      envs: {
        citi_prod: "CITI PROD",
        stage: "STAGE",
        dev: "DEV",
      },
    },
    GS: {
      name: "GS",
      envs: {
        gs_prod: "GS PROD",
        gs_pre_prod: "GS PRE PROD",
        stage: "STAGE",
        dev: "DEV",
      },
    },
  },
  timeZones:{
    ist:{
      name:"India Standard Time",
      short_name:"IST",
      utc_time_difference:+5.30,
      description:"IST is 5:30 hours ahead of UTC",

    },
    gmt:{
      name:"Greenwich Mean Time",
      short_name:"GMT",
      utc_time_difference:+0.00,
      description:"GMT is 0:00 hours ahead of UTC",
    },
    cst:{
      name:"Central Standard Time",
      short_name:"CST",
      utc_time_difference:-6.00,
      description:"GMT is 6:00 hours behind of UTC",
    }
  },
  exchanges:{
    lch_ltd:"LCH_LTD",
    ice_eu:"ICE_EU",
    ice_cc:"ICE_CC",
    ice_us:"ICE_US",
  },
  report_cycle:{
    itd:"ITD",
    eod:"EOD",
  }
};
